function predic_image(){
    

    
    console.log("Processing...")

    let image =cv.imread(my_canvas);
    cv.cvtColor(image, image, cv.COLOR_RGBA2GRAY, 0);
    cv.threshold(image, image, 175, 255, cv.THRESH_BINARY);
    
    let contours = new cv.MatVector();
    let hierarchy = new cv.Mat();
    cv.findContours(image, contours, hierarchy, cv.RETR_CCOMP, cv.CHAIN_APPROX_SIMPLE);
    
    let cnt = contours.get(0);
    let rect = cv.boundingRect(cnt);
    image = image.roi(rect);

    var height = image.rows;
    var width = image.cols;

    if (height > width){
        height = 20
        const scaleFactor = image.rows / height
        width = Math.round(image.cols / scaleFactor)
    } else {
        width = 20
        const scaleFactor = image.cols / width
        height = Math.round(image.rows / scaleFactor)
    }

    let newSize = new cv.Size(width, height)
    cv.resize(image, image, newSize, 0, 0, cv.INTER_AREA)

    const LEFT = Math.ceil(4 + (20 - width) / 2)
    const RIGHT = Math.floor(4 + (20 - width) / 2)
    const TOP = Math.ceil(4 + (20 - height ) / 2)
    const BOTTOM = Math.floor(4 + (20 - height) / 2)
    let COLOR = new cv.Scalar(0, 0, 0, 0)

    cv.copyMakeBorder(image, image, TOP, BOTTOM, LEFT, RIGHT, cv.BORDER_CONSTANT, COLOR)

    // center of mass
    cv.findContours(image, contours, hierarchy, cv.RETR_CCOMP, cv.CHAIN_APPROX_SIMPLE);
    cnt = contours.get(0)
    const Moment = cv.moments(cnt, false)

    const cx = Moment.m10 / Moment.m00
    const cy = Moment.m01 / Moment.m00

    const x_shift = Math.round(image.cols / 2.0 - cx)
    const y_shift = Math.round(image.rows / 2.0 - cy)

    newSize = new cv.Size(image.cols, image.rows)
    const M = cv.matFromArray(2, 3, cv.CV_64FC1, [1, 0, x_shift, 0, 1, y_shift])
    cv.warpAffine(image, image, M, newSize, cv.INTER_LINEAR, cv.BORDER_CONSTANT, COLOR)

    let pixel = image.data
    pixel = Float32Array.from(pixel)
    pixel = pixel.map(function(element){
        return element / 255.0
    })
    
    // console.log(pixel)

    const X = tf.tensor([pixel])
    // console.log('This is x shape')
    // console.log(X.shape)
    // console.log('this is x type')
    // console.log(X.dtype)

    // predited
    const predicted_result = model_loaing.predict(X)
    predicted_result.print()
    const output_result = predicted_result.dataSync()[0]

    // test show image

    const out_put_image = document.createElement('CANVAS');
    cv.imshow(out_put_image, image);
    document.body.appendChild(out_put_image);
    
    
    // clean

    image.delete();
    contours.delete();
    cnt.delete();
    hierarchy.delete();
    M.delete();
    X.dispose()

    return output_result

    };
    
